import React from 'react';
import './Footer.css';
import '../../index.css'



function Footer() {
  return (
    <footer className="footer">
      <div className="footer-content">
        <p>&copy; 2023 Элитная мебель</p>
        <p>Все права защищены</p>
      </div>
    </footer>
  );
}

export default Footer;
